import classes from "./HourlyVariablesTab.module.css";
import { useState } from "react";

const HourlyVariablesTab = () => {
  const [selectedCheckboxes, setSelectedCheckboxes] = useState([]);

  const handleCheckBoxChange = (event) => {
    if (event.target.checked) {
      const newSelectedCheckboxes = [...selectedCheckboxes, event.target.id];
      setSelectedCheckboxes(newSelectedCheckboxes);
    } else {
      const newSelectedCheckboxes = selectedCheckboxes.filter((id) => {
        id !== event.target.id;
      });
      setSelectedCheckboxes(newSelectedCheckboxes);
    }
  };

  console.log(selectedCheckboxes);
  return (
    <>
      <h3>Hourly weather variables</h3>
      <div className={classes.variables}>
        <span>
          <input
            type="checkbox"
            id="temperature2m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="temperature2m">Temperature (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="cloudcoverTotal"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="cloudcoverTotal">Cloudcover Total</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="windSpeed10m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="windSpeed10m">Wind Speed (10m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="soilTemp0cm"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="soilTemp0cm">Soil Temperature (0cm)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="relHumidity"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="relHumidity">Relative Humidity (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="cloudcoverLow"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="cloudcoverLow">Cloudcover Low</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="windSpeed80m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="windSpeed80m">Wind Speed (80m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="soilTemp6cm"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="soilTemp6cm">Soil Temperature (6cm)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="dewPoint"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="dewPoint">Dew Point (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="cloudcoverMid"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="cloudcoverMid">Cloudcover Mid</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="windSpeed120m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="windSpeed120m">Wind Speed (120m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="soilTemp18cm"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="soilTemp18cm">Soil Temperature (18cm)</label>
        </span>
      </div>
    </>
  );
};

export default HourlyVariablesTab;
